;; **
;;; ## Distributions
;; **

;; @@
(defn plot-dg-dist [[id coll]]
  (let [curr (center-degree id t0 tmax :distribution)
         dat {:xs (map first curr)
              :ys (map second curr)}]
    (gg4clj/view
      [[:<- :d (gg4clj/data-frame dat)]
       (gg4clj/r+
         [:ggplot :d [:aes :xs :ys]]
         [:geom_bar {:stat "identity" :fill "#999999"}]
         [:xlab "Degree"]
         [:ylab "Fraction"]
         [:theme_bw]
         [:ggtitle (str "Center Degree distribution of " (element-name coll))])]
      {:width 5 :height 5})))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;radioactive-autumn/plot-dg-dist</span>","value":"#'radioactive-autumn/plot-dg-dist"}
;; <=

;; @@
#_(for [b broadcasters]
  (plot-dg-dist b))
;; @@

;; **
;;; ## Evolutions
;; **

;; @@
(let [curr (->>   broadcasters
                  (map (fn [[id author]] (map :mean (center-degree id t0 tmax :evolution))))
                  (apply map vector)
                  (map stats/mean)
                  )
       dat {:count curr
            :days (range (count curr))}]
    (gg4clj/view
      [[:<- :d (gg4clj/data-frame dat)]
       (gg4clj/r+
         [:ggplot :d [:aes :days :count]]
         [:geom_line {:color "#222222"}]
         [:xlab "Day"]
         [:ylab "Degree"]
         [:theme_bw]
